Heather's Home Movies (1989) 

Bored with the same old tapes Heather takes the business into her own hot little hands as she and roommate Keisha make their own porno movie. A few phone calls is all it takes. And it's lights, camera and Sizzling Action.

Scene 1. Heather Hunter, Yasmine Pendavis
Scene 2. Yasmine Pendavis, Scott Irish
Scene 3. Heather Hunter, Ray Victory
Scene 4. Cheri Taylor, Heather Hunter, Suzie Bartlett, Yasmine Pendavis
Scene 5. Cheri Taylor, Suzie Bartlett, Yasmine Pendavis, Peter Lawrence, Ray Victory, Scott Irish

Classic

